// SPDX-License-Identifier: GPL-3.0

pragma solidity >= 0.7.0 < 0.8.0;

contract Auction {
    
    address payable Owner;
    address public highestBidder; // The highest bidder's address
    uint public highestBid; // The amount of the highest bid
    
    uint private tempHighestBid;
    address private tempHighestBidder;
    uint private temp;
    
    mapping(address => uint) public userBalances; // mapping for the amount to return
    
    constructor() {
        // contractor
        Owner = msg.sender;
        highestBid = 0;
        highestBidder = Owner;
    }
    
    modifier notOwner(){
        require(msg.sender != Owner,"ERROR - You are the owner, you can't bid!");
        _;
    }
    
    modifier notHighestBidder(){
        require(msg.sender != highestBidder, "ERROR - You are the highest bidder, you cant't withdraw!");
        _;
    }
    
    function bid() public payable notOwner{
        // Function to process bid
        require(msg.value>highestBid, "ERROR - The current highest bid is greater than yours!");
        
        tempHighestBid = highestBid;
        tempHighestBidder = highestBidder;
        
        highestBid = msg.value;
        highestBidder = msg.sender;
        
        if(userBalances[msg.sender] > 0) {
            if(!msg.sender.send(userBalances[msg.sender])){
                highestBid = tempHighestBid;
                highestBidder = tempHighestBidder;
                require(true, "ERROR - Unexpexted error during bid, try again later!");
            }
        }
        
        userBalances[msg.sender] = msg.value;
    }
    
    function withdraw() public notHighestBidder notOwner{
        // Function to withdraw the amount of bid to return
        require(userBalances[msg.sender] > 0, "ERROR - Withdraw amount of 0");
        
        temp = userBalances[msg.sender];
        userBalances[msg.sender] = 0;
        
        if(!msg.sender.send(temp)) {
            userBalances[msg.sender] = temp;
            require(true, "ERROR - Unexpected error during withdraw, try again later!");
        }
    }
}
